import axios from 'axios'

const USERS_REST_API_URL = 'http://localhost:8080/api/people';

// Testing, delete
const USERS_REST_API_URL_ID = 'http://localhost:8080/api/people?name=Fred%20Astaire';


class UserService {

    getUsers(){
        return axios.get(USERS_REST_API_URL);
    }

    getUsersById(){
        let formData = new FormData();
        return axios.get(USERS_REST_API_URL_ID); // replace with form data
    }
